(45, 1, '2021-08-14 12:02:18', '2021-08-14 12:02:18', '<div class=\"title\">About the Book<input id=\"ctl00_phBody_ProductLongDesc_btnColExp\" name=\"ctl00$phBody$ProductLongDesc$btnColExp\" type=\"submit\" value=\"Hide Detail\" />\r\n<div class=\"loadingDiv\"></div>\r\n</div>\r\n<div id=\"divcontent\"><b>A<i>New York Times</i>bestseller</b><b>From Vice President-Elect Kamala Harris, one of America\'s most inspiring political leaders, a book about the core truths that unite us, and the long struggle to discern what those truths are and how best to act upon them, in her own life and across the life of our country</b>\r\n\r\nVice President-Elect Kamala Harris\'s commitment to speaking truth is informed by her upbringing. The daughter of immigrants, she was raised in an Oakland, California community that cared deeply about social justice; her parents--an esteemed economist from Jamaica and an admired cancer researcher from India--met as activists in the civil rights movement when they were graduate students at Berkeley. Growing up, Harris herself never hid her passion for justice, and when she became a prosecutor out of law school, a deputy district attorney, she quickly established herself as one of the most innovative change agents in American law enforcement. She progressed rapidly to become the elected District Attorney for San Francisco, and then the chief law enforcement officer of the state of California as a whole. Known for bringing a voice to the voiceless, she took on the big banks during the foreclosure crisis, winning a historic settlement for California\'s working families. Her hallmarks were applying a holistic, data-driven approach to many of California\'s thorniest issues, always eschewing stale tough on crime rhetoric as presenting a series of false choices. Neither tough nor soft but<i>smart</i>on crime became her mantra. Being smart means learning the truths that can make us better as a community, and supporting those truths with all our might. That has been the pole star that guided Harris to a transformational career as California\'s attorney general, as a United States senator, and now as vice president-elect, grappling in every role with an array of complex issues, from health care and the new economy to immigration, national security, the opioid crisis, and accelerating inequality.\r\n\r\nBy reckoning with the big challenges we face together, drawing on the hard-won wisdom and insight from her own career and the work of those who have most inspired her, Kamala Harris offers in THE TRUTHS WE HOLD a master class in problem solving, in crisis management, and leadership in challenging times. Through the arc of her own life, on into the great work of our day, she communicates a vision of shared struggle, shared purpose, and shared values. In a book rich in many home truths, not least is that a relatively small number of people work very hard to convince a great many of us that we have less in common than we actually do, but it falls to us to look past them and get on with the good work of living our common truth. When we do, our shared effort will continue to sustain us and this great nation, now and in the years to come.\r\nAbout the Author:<b>Kamala D. Harris</b>is the Vice President of the United States of America. She began her career in the Alameda County District Attorney\'s Office, then was elected district attorney of San Francisco. As California\'s attorney general, Harris prosecuted transnational gangs, big banks, Big Oil, and for-profit colleges, and fought against attacks on the Affordable Care Act. She also fought to reduce elementary school truancy, pioneered the nation\'s first open data initiative to expose racial disparities in the criminal justice system, and implemented implicit bias training for police officers. The second Black woman ever elected to the U.S. Senate and the first female, first Black, and first Indian-American Vice President, Harris has worked to reform our criminal justice system, raise the minimum wage, make higher education tuition-free for the majority of Americans\r\n\r\n</div>', 'The Truths We Hold', '<label id=\"ctl00_phBody_ProductDetail_lblAuthor1\">By:<a href=\"https://www.bookswagon.com/author/kamala-harris\">Kamala Harris</a></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType1\">(Author)</label><label id=\"ctl00_phBody_ProductDetail_lblAuthor2\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType2\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor3\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType3\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor4\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType4\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor5\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType5\"></label><label id=\"ctl00_phBody_ProductDetail_lblPublisher\">| Publisher:<a href=\"https://www.bookswagon.com/publisher/penguin-press\">Penguin Press</a></label><label id=\"ctl00_phBody_ProductDetail_lblRelease\">| Released: 08 Jan 2019</label><label id=\"ctl00_phBody_ProductDetail_lblPublisherImprint\">| Publisher Imprint: Penguin Press</label>\r\n<div class=\"book-details\">\r\n<div class=\"stock-info\">\r\n<div id=\"ctl00_phBody_ProductDetail_lblAvailable\" class=\"available\">International Edition</div>\r\n<div class=\"shipping-info\"><label id=\"ctl00_phBody_ProductDetail_lblBusiness\">Ships within<b>14-16 Business Days</b></label><label id=\"ctl00_phBody_ProductDetail_lishipping\">\r\nFree Shipping in India and low cost Worldwide.</label></div>\r\n</div>\r\n<div class=\"clearfloat\"></div>\r\n</div>', 'publish', 'open', 'closed', '', 'the-truths-we-hold', '', '', '2021-08-15 13:00:33', '2021-08-15 13:00:33', '', 0, 'http://localhost/site1/?post_type=product&#038;p=45', 0, 'product', '', 0),
