(47, 1, '2021-08-14 12:13:14', '2021-08-14 12:13:14', 'The four short novels in this collection by the author of<i>The Age of Innocence</i>are set in the New York of the 1840s, \'50s, \'60s, and \'70s, each one revealing the tribal codes and customs that ruled society, portrayed with the keen style that is uniquely Edith Wharton\'s. Originally published in 1924 and long out of print, these tales are vintage Wharton, dealing boldly with such themes as infidelity, illegitimacy, jealousy, the class system, and the condition of women in society. Included in this remarkable quartet are<i>False Dawn,</i>which concerns the stormy relationship between a domineering father and his son;<i>The Old Maid,</i>the best known of the four, in which a young woman\'s secret illegitimate child is adopted by her best friend -- with devastating results;<i>The Spark,</i>about a young man\'s moral rehabilitation, which is sparked by a chance encounter with Walt Whitman; and<i>New Year\'s Day,</i>an O. Henryesque tale of a married woman suspected of adultery.<i>Old New York</i>is Wharton at her fin\r\nAbout the Author: America\'s most famous woman of letters, and the first woman to win the Pulitzer Prize,<b>Edith Wharton</b>was born into one of the last leisured class families in New York City, as she put it, in 1862. Educated privately, she was married to Edward Wharton in 1885, and for the next few years, they spent their time in the high society of Newport (Rhode Island), then Lenox (Massachusetts) and Europe. It was in Europe that Wharton first met Henry James, who was to have a profound and lasting influence on her life and work. Wharton\'s first published book was a work of nonfiction, in collaboration with Ogden Codman,<i>The Decoration of Houses</i>(1897), but from early on, her marriage had been a source of distress, and she was advised by her doctor to write fiction to relieve her nervous tension. Wharton\'s first short stories appeared in<i>Scribners Magazine,</i>and though she published several volumes of fiction around the turn of the century, including<i>The Greater Inclination</i>(1899),<i>The Touchstone</i>(1900),<i>Crucial Instances</i>(1901),<i>The Valley of Decision</i>(1902),<i>Sanctuary</i>(1903), and<i>The Descent of Man and Other Stories</i>(1904), it wasn\'t until 1905, with the publication of the bestselling<i>The House of Mirth,</i>that she was recognized as one of the most important novelists of her time for her keen social insight and subtle sense of satire. In 1906, Wharton visited Paris, which inspired<i>Madame de Treymes</i>(1907), and made her home there in 1907, finally divorcing her husband in 1912. The years before the outbreak of World War I represent the core of her artistic achievement, when<i>Ethan Frome</i>(1911 ),<i>The Reef</i>(1912), and<i>The Custom of the Country</i>(1913) were published. During the war, she remained in France organizing relief for Belgian refugees, for which she was later awarded the Legion of Honor. She also wrote two novels about the war,<i>The Marne</i>(1918) and<i>A Son at the Front</i>(1923), and continued, in France, to write about New England and the Newport society she had known so well in<i>Summer</i>(1917), the companion to<i>Ethan Frome,</i>and<i>The Age of Innocence</i>(1920), for which she won the Pulitzer Prize. Wharton died in France in 1937. Her other works include<i>Old New York</i>(1924),<i>The Mother\'s Recompense</i>(1925),<i>The Writing of Fiction</i>(1925),<i>The Children</i>(1928),<i>Hudson River Bracketed</i>(1929), and her autobiography,<i>A Backward Glance</i>(193', 'Old New York', '<label id=\"ctl00_phBody_ProductDetail_lblAuthor1\">By:<a href=\"https://www.bookswagon.com/author/edith-wharton\">Edith Wharton</a></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType1\">(Author)</label><label id=\"ctl00_phBody_ProductDetail_lblAuthor2\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType2\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor3\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType3\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor4\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType4\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthor5\"></label><label id=\"ctl00_phBody_ProductDetail_lblAuthorType5\"></label><label id=\"ctl00_phBody_ProductDetail_lblPublisher\">| Publisher:<a href=\"https://www.bookswagon.com/publisher/scribner-book-company\">Scribner Book Company</a></label><label id=\"ctl00_phBody_ProductDetail_lblRelease\">| Released: 01 Mar 1995</label><label id=\"ctl00_phBody_ProductDetail_lblPublisherImprint\">| Publisher Imprint: Scribner Book Company</label>', 'publish', 'open', 'closed', '', 'old-new-york', '', '', '2021-08-14 20:44:44', '2021-08-14 20:44:44', '', 0, 'http://localhost/site1/?post_type=product&#038;p=47', 0, 'product', '', 0),
